import React from "react";
import ProjectCard from "./ProjectCard";

const Projects = () => {
  const projects = [
    {
      title: "E-commerce Website",
      technologies: "React, Node.js, MongoDB",
      description:
        "A full-stack e-commerce platform with user authentication, product management, and payment processing.",
    },
    {
      title: "Weather App",
      technologies: "React, OpenWeather API",
      description:
        "A responsive weather application that provides real-time forecasts for locations worldwide.",
    },
    {
      title: "Task Management Tool",
      technologies: "React, Firebase",
      description:
        "A collaborative project management application with real-time updates and drag-and-drop functionality.",
    },
  ];

  return (
    <div>
      <h2 className="text-3xl font-bold mb-6">My Projects</h2>
      <div className="grid md:grid-cols-2 gap-6">
        {projects.map((project, index) => (
          <ProjectCard key={index} project={project} />
        ))}
      </div>
    </div>
  );
};

export default Projects;
